@CarlRobichaud Where some ChatGPT fears are justified is mass, fast misinfo creation, FP had a good piece hitting this: https://t.co/VwJfjMo583

Journal of Experimental Political Science has a good one too, especially the nuance that misinfo doesn't really change views
https://t.co/Ur4KDg6pAO

@joshletoczuba Artificial Intelligence if it's used lazily.

Overdependence on ChatGPT will easily be one of the larger problems we'll face this decade.

If the lockdowns with rampant cheating wasn't bad enough, this makes things a lot worse/harder.

@pontivflex One of the first things I did was make a ChatGPT "Ares", based on the Ancient Greek god.

Made sure it had an actual personality. Tone was "fantasy king" style. Asked it war strategy questions. Worked perfectly.

Not sure on voice and integrating it all in a package tho

@Shalxxx112 Yes but with AI, they can replace humans who do laborious and simple work and also replace complex work. 

Chatgpt literally passed a US medical licensing exam without clinician input. 

Then what should be done when AI replace massive amounts of people? Let them starve?
